import { Box, Grommet, Tab, Tabs, Form, FormField, Button, TextInput } from 'grommet';
import React from 'react';
import Foooter from './Foooter';
import Headerr from './Headerr';

export default function TabTile () {

    const theme = {
        global: {
          colors: {
            brand: '#01A982',
          },
          font: {
            family: 'Roboto',
            size: '18px',
            height: '20px',
          },
        },
      };

    return(
        <Grommet theme={theme}>
        <Headerr />
        <Box pad="small">
        <Tabs>
            <Tab title="Procurement" tabIndex="1">
            <Box justify="center" pad="small">
                <Box direction="column" alignSelf="center"  border={{ color: 'brand', size: 'small' }} pad="small"> 
                    <Form key={1}>
                        <FormField label="Requestor" width="large">
                        <TextInput placeholder="Enter Requestor" name="Device1" />
                        </FormField>
                        <FormField label="PR Number" width="large">
                        <TextInput placeholder="Enter PR Number" name="Device2" />
                        </FormField>
                        <FormField label="PO Number" width="large">
                        <TextInput placeholder="Enter PO Number" name="Device3" />
                        </FormField>
                        <Button key={1} type="submit" primary label="Submit" />
                    </Form>
                </Box> 
            </Box> 
            </Tab>
            <Tab title="Forwader" tabIndex="2" />
            <Tab title="CHA" tabIndex="3" />
            <Tab title="Supplier & Product" tabIndex="4" />
            <Tab title="Customs" tabIndex="5" />
            <Tab title="Invoice Remittance" tabIndex="6" />
            <Tab title="Asset-Grave" tabIndex="7" />
        </Tabs>
        </Box>
        <Foooter />
        </Grommet>
    ); 
}
